import React from 'react';
import './Table.css';

function Table() {
  const daysOfWeek = ['Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Saturday'];
  const hours = ['I', 'II', 'III', 'Break', 'IV', 'Mentoring', 'Lunch', 'V', 'VI', 'VII'];
  const timeSlots = [
    '8:40 AM - 9:35 AM',
    '9:35 AM - 10:30 AM',
    '10:30 AM - 11:25 AM',
    '11:25 AM - 11:45 AM', // Break
    '11:45 AM - 12:40 PM', // IV
    '12:40 PM - 12:55 PM', // Mentoring
    '12:55 PM - 1:40 PM',  // Lunch
    '1:40 PM - 2:30 PM',   // V
    '2:30 PM - 3:20 PM',   // VI
    '3:20 PM - 4:10 PM',   // VII
  ];

  return (
    <div>
      <div className="college-timetable">
        <table>
          <thead>
            <tr>
              <th>Time</th>
              {hours.map((hour, index) => (
                <th key={index}>{hour}</th>
              ))}
            </tr>
            <tr>
              <th>Time</th>
              {timeSlots.map((slot, index) => (
                <th key={index}>{slot}</th>
              ))}
            </tr>
          </thead>
          <tbody>
            {daysOfWeek.map((day, dayIndex) => (
              <tr key={dayIndex}>
                <td>{day}</td>
                {hours.map((hour, hourIndex) => (
                  <td
  key={hourIndex}
  style={
    hourIndex === 3 || hourIndex === 4 || hourIndex === 6
      ? {  borderBottom: 'none' }
      : { borderLeft: '1px solid black', borderRight: '1px solid black', borderBottom: 'none' }
  }
></td>
                ))}
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default Table;
